  return (
    <div className="HomePage">
      <header className="header headerRegistre">
       <Logo />
      </header>
      <aside className='aside asideRegistre'>
        <AsideRegistre />
      </aside>
      <main className='main mainRegistre'>
        <Registre/>
      </main>
      <footer className='footer'>

      </footer>
    </div>
  );
}

export default Category;
